Submarine Patrol

Technology, War Documentary hosted by Bill Paterson, published by Channel 5 in 2012 - English narration


Information
------------------------------

Submarine Patrol
Unlike other theatres of war the world of the submarine infamously nicknamed &quot;the hidden hunter&quot;, has long remained shrouded in mystery, its vessels more complicated that a space shuttle, and the water they hide in less explored than space. The covert missions of a submarine are kept top secret and notoriously guarded by the MOD and Royal Navy... Until now for the first time, the enigma is about to be revealed, with unprecedented access to an operational nuclear power Hunter Killer 'Super' Submarine in this stunning 3 part series. Submarine Patrol takes the viewer on an unmissable, rare journey into the heart of the action of life as a submariner, with graphic and gripping tales of life and operations on board




2)  Action Stations 
While on stand-by to assist a sister submarine off the Libyan Coast, the boat's company is presented with a catalogue of man-made errors and a mission-threatening fault to one of the steam generators. Can the crew and the vessel adapt to the change of tasking at such short notice?



